import "../styles/addpost.css"

const Addpost = () => {
    return ( 
        <div className="addpost">
            <section class="d-flex">
                <div>
                    <img src="/images/leftpic.png" alt="" />
                </div>
                <div>
                    <h1 class="fw-bold border-bottom border-dark border-">ADD POST</h1>
                </div>
            </section>
        </div>
     );
}

export default Addpost;
